import React from "react";
import { Stack, Box } from "@mui/material";

import { VideoCard } from "../../";

const Videos = ({ videos }) => {
  return (
    <Stack direction="row" flexWrap="wrap" gap={2} justifyItems="start">
      {videos.map((idx, item) => (
        <Box key={idx}>{item.id.videId && <VideoCard />}</Box>
      ))}
    </Stack>
  );
};

export default Videos;
